import React from "react";

import Icon from "./icon"

export function Sidebar(props) {
  return (<div className="sidebar">
    <Icon title={props.homeIcon, props.title} />
    <Icon iconUrl={props.fireIcon, props.title} />
    <Icon iconUrl={props.subscriptionsIcon, props.title} />
    <Icon iconUrl={props.playlist, props.title} />
  </div>)
}
